import '../src/css/skeleton.css'

function App() {
  return (
    <div className="App">
      <body>
        <div className="container">
          <div className="row">
            <div className="four columns">
              <div className='mfio-card'>
                <img className='avitar'></img>
              <h6>Matt</h6>
              </div>
            </div>  
          </div>
        </div>
      </body>
    </div>
  );
}

export default App;
